import React from "react";
import styled from "styled-components";

import { PetCard } from "./petsList/PetCard";

const PetsListContainer = styled.section`
  display: flex;
  justify-content: center;
  margin-top: 56px;
`;

const PatsList = styled.section`
  max-width: 614px;
  width: 100%;
`;

export const PetsList = ({ pets }) => (
  <PetsListContainer>
    <PatsList>
      {pets.map(pet => (
        <PetCard key={pet.name} pet={pet} />
      ))}
    </PatsList>
  </PetsListContainer>
);
